import React from "react";
import { Link } from "react-router-dom";

const Home = () => (
  <div className="container text-center">
    <div className="jumbotron mt-5">
      <h1 className="display-4">Welcome to "GhorKuno"</h1>
      <p className="lead">This is an system with production level features!</p>
      <hr className="my-4" />
      <p className="fs-5">Please login first!!</p>
    </div>
  </div>
);

export default Home;
